#include <stdio.h>
#include <stdlib.h>

int linearSearch(int arr[], int n, int x)
{
	for (int i = 0; i < n; i++){
	       if (arr[i] == x)
			return i;
	}
	return -1;
}

int binarySearch(int arr[], int l, int r, int x)
{
	if (r>=l){
		int mid = l + (r - l) / 2;
		if (arr[mid] == x)
			return mid;
		if (arr[mid] > x)
			return binarySearch(arr, l,mid - 1, x);
		return binarySearch(arr, mid + 1, r, x);
	}
	return -1;
}

int min(int a, int b){ return (a <= b) ? a : b;}

int fibonacciSearch(int arr[], int n, int x)
{
	int fibMm2 = 0;
	int fibMm1 = 1;
	int fibM = fibMm2 + fibMm1;

	while (fibM < n){
		fibMm2 = fibMm1;
		fibMm1 = fibM;
		fibM = fibMm2 + fibMm1;
	}

	int offset = -1;

	while (fibM > 1){
		int i = min(offset + fibMm2, n-1);

		if (arr[i] < x) {
			fibM = fibMm1;
			fibMm1 = fibMm2;
			fibMm2 = fibM - fibMm1;
			offset = i;
		}
		
		else if (arr[i] > x) {
			fibM = fibMm2;
			fibMm1 = fibMm1 - fibMm2;
			fibMm2 = fibM - fibMm1;
		}
		else
			return i;
	}
	if (fibMm1 && arr[offset + 1] == x)
		return offset + 1;
	return -1;
}
